long_desc.thetext:
After a file picker dialog is closed with a file selected, an exception is fired at TouchCore.js, line 302, "Unable to get property 'identifier' of undefined or null reference".  The offending statement is

if (type == "touchend" || type == "touchcancel" && domEvent.changedTouches[0]) {
        delete this.__touchStartPosition[domEvent.changedTouches[0].identifier];
}

It would seem that the problem is caused by missing parentheses around the comparisons - operator && has precedence over operator ||, (see http://en.cppreference.com/w/c/language/operator_precedence).  So in the current code domEvent.changedTouches[0] does not get compared to null in the if statement if type=="touchend" is true.  The fix would be to enclose the pair of comparisons in a common set of parentheses:

if ((type == "touchend" || type == "touchcancel") && domEvent.changedTouches[0]) {
        delete this.__touchStartPosition[domEvent.changedTouches[0].identifier];
}

The exception is silent if no javascript debugger is open, but annoying enough during debugging ...
